import React from "react";
import Menu from "./components/Menu";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Provider } from "react-redux";
import { legacy_createStore } from "redux";
import Initialreducer from "./components/Redux/reducers/Initialreducer";
import Afficher from "./components/Afficher";
import Ajouter from "./components/Ajouter";
import Modifier from "./components/Modifier";
export const store = legacy_createStore(Initialreducer);
export default function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Menu/>}>
            <Route path="/Afficher" element={<Ajouter/>}/>
            <Route path="/Ajouter" element={<Ajouter/>}/>
            <Route path="/Modifier/:code" element={<Modifier/>}/>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
